import React from "react";
import "./PropertyCard.css";

const PropertyCard = ({ property }) => {
  if (!property) return null;

  const {
    "Project Name": projectName,
    BHK,
    Budget,
    "Carpet Area": carpetArea,
    Readiness,
    City,
    Locality,
    Amenities = [],
    URL: ctaURL, // ðŸ‘ˆ renamed to avoid redeclaration conflict
  } = property;

  // âœ… Use backend CTA URL if available, otherwise generate fallback from project name
  const finalURL =
    ctaURL ||
    `/project/${projectName?.toLowerCase().trim().replace(/\s+/g, "-")}`;

  return (
    <div className="property-card">
      <h3 className="property-title">{projectName}</h3>

      <p className="property-info">
        {City}, {Locality}
      </p>

      <p className="property-info">
        {BHK} | {Budget} | {carpetArea} sq.ft
      </p>

      <p className="property-readiness">
        {Readiness === "READY_TO_MOVE" ? "Ready to Move" : "Under Construction"}
      </p>

      {Amenities.length > 0 && (
        <p className="property-amenities">
          Amenities: {Amenities.slice(0, 3).join(", ")}
        </p>
      )}

      {/* âœ… CTA link (opens in new tab if full domain, otherwise internal navigation) */}
      {finalURL.startsWith("http") ? (
        <a href={finalURL} className="property-cta" target="_blank" rel="noopener noreferrer">
          View Project
        </a>
      ) : (
        <a href={finalURL} className="property-cta">
          View Project
        </a>
      )}
    </div>
  );
};

export default PropertyCard;
